import React from 'react';
import Content from './content';
import LoginForm from './LoginForm';


const Body = () => {
  return (
    <main className="body">
      <div className="row">
        <div className="column">
          <Content />
        </div>
        <div className="column">
          <LoginForm />
        </div>
      </div>
    </main>
  );
};

export default Body;
